import 'bootstrap/dist/css/bootstrap.min.css';
import { Jumbotron, Navbar } from 'reactstrap';

function HomePage() {
    return (
        <div>
            <Navbar color="li"></Navbar>
            <Jumbotron>
                <h1 className="text-center">Welcome to Site!</h1>
            </Jumbotron>
        </div>
    )
}

export default HomePage
